import logo from './logo.svg';
import './App.css';

class About extends Component {
  render() {
    return (
    <div className="about-container">
     <h1>About Me</h1>
     <p>Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore  laborum.</p>
    </div>
    );
  }
}

export default About;
